var currX = 0;  // Start at '5'. which is 0,0
var currY = 0;
var combo = "";

//var arrDir = [
//    'ULL'
//    , 'RRDDD'
//    , 'LURDL'
//    , 'UUUUD'
//];

var arrDir = [
    ''
    , ''
    , ''
    , ''
    , ''

    ];

for (var i = 0; i < arrDir.length; i++) {
    var thisDirStr = arrDir[i];
    
    for (var j = 0; j < thisDirStr.length; j++) {
        var thisDir = thisDirStr.charAt(j);
        
        if (thisDir === 'L' && currX > -1) currX--;
        else if (thisDir === 'R' && currX < 1) currX++;
        else if (thisDir === 'U' && currY < 1) currY++;
        else if (thisDir === 'D' && currY > -1) currY--;
    }
    
    if (currX === -1 && currY === 1) combo += "1";
    else if (currX === 0 && currY === 1) combo += "2";
    else if (currX === 1 && currY === 1) combo += "3";
    else if (currX === -1 && currY === 0) combo += "4";
    else if (currX === 0 && currY === 0) combo += "5";
    else if (currX === 1 && currY === 0) combo += "6";
    else if (currX === -1 && currY === -1) combo += "7";
    else if (currX === 0 && currY === -1) combo += "8";
    else if (currX === 1 && currY === -1) combo += "9";
    
    console.log("NUM[" + i + "]: " + combo);
}